webpackJsonp([0xe60136e3900d],{343:function(e,a){e.exports={data:{project:{html:'<iframe class="media video" width="640" height="360" src="http://www.youtube.com/embed/gMG8yLw0-q0?rel=0" frameborder="0" allowfullscreen></iframe>\n<p>Fanfare allowed concertgoers to link up with Facebook friends with similar musical tastes and assisted with group ticket purchasing/distributing of funds.</p>\n<p>As a huge music fan and concertgoer myself, I came up with the idea after trying and failing to find a friend to go see <a href="http://soundcloud.com/quadronmusic">Quadron</a> with me at Rockwood Music Hall.</p>\n<p>The app was written in PHP and Javascript in less than 24 hours and utilized the Facebook and Songkick APIs for AngelHack NYC 2012. My team took home a prize from Facebook for Fanfare\'s use of the Facebook Open Graph API.</p>',frontmatter:{title:"Fanfare",link:null,tags:["hackathon"],github:null,image:null,created:"June 2012"}}},pathContext:{slug:"/projects/fanfare/"}}}});
